import React from "react";
import { Container, Row, Col, Image } from "react-bootstrap";
import jersey from "./IMG/jersey.jpg";
import necklace from "./IMG/necklace.jpg";
import watch from "./IMG/watch.jpg";

function Products() {
  return (
    <div>
      <Container>
        <Row>
          <Col xs={6} md={4} thumbnail>
            <Image src={watch} thumbnail />
            <h3>Watch</h3>
          </Col>
          <Col xs={6} md={4}>
            <Image src={necklace} thumbnail />
          </Col>
          <Col xs={6} md={4}>
            <Image src={jersey} thumbnail />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Products;
